import React, {Component} from 'react'
import Header from "./Header"
import Bottom from "./Bottom"
import axios from "axios"

class Base extends Component{
    render(){
        return(
            <div style={divStyle} className="baseContainer">
                <Header/>   
                <Bottom/>                        
            </div>         
        )
    }
}

const divStyle = {
    width: "100%",
    height: "100%"
}


export default Base
